import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';  // Import global CSS
import App from './App';  // Import main App component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
